import React from 'react';
import Navbar from '../components/Navbar';
import './Login.css';

const Login = () => {
  return (
    <>
      <Navbar />
      <div className="login-container">
        <div className="login-card">
          <h2>Create a new account</h2>

          <button className="social-login-btn google">
            <img src="path/to/google-logo.png" alt="Google" className="social-logo" /> Sign Up with Google
          </button>

          <button className="social-login-btn facebook">
            <img src="path/to/facebook-logo.png" alt="Facebook" className="social-logo" /> Sign Up with Facebook
          </button>

          <button className="create-account-btn">Create an Account</button>

          <p className="sign-in">
            Already have an account? <a href="/login">Sign In</a>
          </p>
        </div>
      </div>
    </>
  );
};

export default Login;
